import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const UserDashboard = () => {
  const navigate = useNavigate();
  const API_BASE = process.env.REACT_APP_API_BASE || 'http://localhost:5000';
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [summary, setSummary] = useState({ past: [], live: [], upcoming: [] });

  const storedUserRaw = typeof window !== 'undefined' ? localStorage.getItem('user') : null;
  let storedUser = null;
  try { storedUser = storedUserRaw ? JSON.parse(storedUserRaw) : null; } catch {}
  const userId = storedUser?.id;

  useEffect(() => {
    if (!userId) {
      navigate('/login');
      return;
    }

    const run = async () => {
      try {
        setLoading(true);
        const res = await fetch(`${API_BASE}/api/participants/user/${userId}/summary`);
        const data = await res.json();
        if (!res.ok) throw new Error(data.message || 'Failed to load registrations');
        setSummary({
          past: data.past || [],
          live: data.live || [],
          upcoming: data.upcoming || []
        });
      } catch (e) {
        setError(e.message);
      } finally {
        setLoading(false);
      }
    };
    run();
  }, [userId]);

  const Section = ({ title, items }) => (
    <section className="dash-section">
      <div className="dash-section-header">
        <h2>{title}</h2>
        <span className="count-badge">{items.length}</span>
      </div>
      {items.length === 0 ? (
        <div className="empty">No events</div>
      ) : (
        <ul className="event-list">
          {items.map(ev => (
            <li key={ev.registrationId} className="event-item">
              <div className="event-main">
                <Link to={`/events/${ev.eventId}`} className="event-title">{ev.title}</Link>
                <div className="event-meta">
                  <span>{new Date(ev.startDate).toLocaleString()}</span>
                  {ev.endDate && <span> - {new Date(ev.endDate).toLocaleString()}</span>}
                  <span> • {ev.location}</span>
                </div>
              </div>
              <div className="event-status">{ev.status}</div>
            </li>
          ))}
        </ul>
      )}
    </section>
  );

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>My Events</h1>
        <div className="header-actions">
          <Link to="/profile-settings" className="btn btn-outline">Profile</Link>
          <Link to="/events" className="btn btn-primary">Browse Events</Link>
        </div>
      </div>

      {error && <div className="alert error">{error}</div>}
      {loading ? (
        <div className="loading">Loading your registrations...</div>
      ) : (
        <div className="dashboard-grid">
          <Section title="Live Now" items={summary.live} />
          <Section title="Upcoming" items={summary.upcoming} />
          <Section title="Past" items={summary.past} />
        </div>
      )}
    </div>
  );
};

export default UserDashboard;
